import React from "react";
import "./NavigationItems";

export default function NavigationItems(props) {
  return (
    <ul style={{display: "none"}}>
      {props.subcategories.map(subcategory => (
        <li key={subcategory.id}>{subcategory.name}</li>
      ))}
    </ul>
  );
}
